import React from "react";
import { css } from 'emotion';
import styled from '@emotion/styled';
import tw from 'tailwind.macro';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
import Data from './components/countriesData/data.js';
import CovidGraph from './components/countriesData/countryInfo.js';

let Button = styled.button`
  ${tw`
    appearance-none bg-indigo text-indigo-lightest
    border-0 p-3 rounded-default font-mono cursor-pointer
    text-xs
  `};
`
let hoverStyles = css(tw`hover:bg-indigo-light`);

export default function App() {
  return (
    <Router> 
      <div>   
        <Switch>
          <Route exact path={`/countriesId/:countryId`}>
          <CovidGraph/>
          </Route>
          <Route path="/">
            <Data />
          </Route>
          </Switch>
        </div>
    </Router>
  );
}
